import React from 'react';
import { Link } from 'react-router-dom';

const Nav = () => {
    return (
        <nav className='navbar'>
            <span className='navbar__clase'>x</span>
            
            <Link to="/">
                <img 
                className="eventlogo__" 
                src="" 
                alt="" />
            </Link>
        </nav>
    );
};

export default Nav;
